import React, { Component } from 'react';

export default class Searchbar extends Component {
    render() {
        return (
            <div>

                <div className=''>
                  <div className=''>

                        <input  className="inpt" type="search" placeholder="Search..." />
                        <span  className="search_icon"><i className="fas fa-search"></i></span>

                  </div>
               </div>

            </div>
        );
    }
}
